import React from "react";

function ArrayBars({ array, sorting }) {
  return (
    <div className="absolute left-[100px] mt-8 flex justify-center items-end">
      {array.map((value, idx) => (
        <div
          key={idx}
        >{value}</div>
      ))}
    </div>
  );
}

export default ArrayBars;
